import axios from 'axios';
import GoogleButton from 'react-google-button'
function Dashboard() {
const handleClick = (e) => {
  console.log('clicked')
  axios.get('http://localhost:5000/api',{ withCredentials: true }).then((response)=>
  {
      console.log('Successfully made the request', response)    
  }).catch((err)=>{
    console.log('An error has occured', err)
  })
}
  return (
    <>
    <div className="admin-login">
        <h1> Login to go to the Admin Panel </h1>
        <GoogleButton onClick={handleClick}
        />
    </div>
    </>
  );
}

export default Dashboard;
